import './App.css';
import { BrowserRouter as Router, Route, Routes, useLocation } from 'react-router-dom';
import { CSSTransition, TransitionGroup } from 'react-transition-group';
import Header from './components/Header';
import Imprint from './components/Imprint';
import Navigation from './components/Navigation';
import Footer from './components/Footer';
import Service from './components/Service';
import Profile from './components/Profile';
import Work from './components/Work';
import Process from './components/Process';
import PersonaKit from './work/PersonaKit';
import DentaltechnikWeber from './work/DentaltechnikWeber';
import ShapeUp from './work/ShapeUp';
import Lottie from 'lottie-react';
import logoAnimation from './lottie/logoAnimation.json';
import { useState, useEffect } from 'react';
import { Helmet, HelmetProvider } from 'react-helmet-async';

function App() {
  const location = useLocation();
  const [firstLoad, setFirstLoad] = useState(true);

  useEffect(() => {
    window.scrollTo(0, 0);
  }, [location]);

  useEffect(() => {
    const timer = setTimeout(() => {
      setFirstLoad(false);
    }, 1000);
    return () => clearTimeout(timer);
  }, []);

  return (
    <div className="App flex flex-col items-center w-full">
      <Navigation />
      <TransitionGroup className="w-full">
        <CSSTransition
          key={location.key}
          timeout={1100}
          classNames="black-screen"
        >
          {state => (
            <div className="relative w-full h-full">
              <Routes location={location} className="w-full">
                <Route
                  path="/"
                  element={
                    <>
                      <Helmet>
                        <title>Home – Joschka Kreusser</title>
                        <meta name="description" content="Willkommen auf meinem Portfolio. Entdecke meine Projekte und Services." />
                        <meta property="og:title" content="Joschka Kreusser" />
                        <meta property="og:description" content="Willkommen auf meinem Portfolio. Entdecke meine Projekte und Services." />
                        <meta property="og:image" content="/android-chrome-512x512.png" />
                        <link rel="canonical" href="https://www.joschka-kreusser.de/" />
                      </Helmet>
                      <Header />
                      <main>
                        <Work />
                        <Process />
                        <Profile />
                        <Service />
                      </main>
                      <section className='w-full bg-white'>
                        <Footer />
                      </section>
                    </>
                  }
                />
                <Route
                  path="/imprint"
                  element={
                    <>
                      <Helmet>
                        <title>Impressum – Joschka Kreusser</title>
                        <meta name="description" content="Hier finden Sie das Impressum und rechtliche Informationen zu meinem Portfolio. Erfahren Sie mehr über die rechtlichen Details meiner Website." />
                        <meta property="og:title" content="Impressum – Joschka Kreusser" />
                        <meta property="og:description" content="Hier finden Sie das Impressum und rechtliche Informationen zu meinem Portfolio. Erfahren Sie mehr über die rechtlichen Details meiner Website." />
                        <meta property="og:image" content="/android-chrome-512x512.png" />
                        <link rel="canonical" href="https://www.joschka-kreusser.de/imprint" />
                      </Helmet>
                      <Imprint />
                      <section className='w-full bg-white'>
                        <Footer />
                      </section>
                    </>
                  }
                />
                <Route
                  path="/personakit"
                  element={
                    <>
                      <Helmet>
                        <title>PersonaKit – Joschka Kreusser</title>
                        <meta name="description" content="PersonaKit ist eine SaaS-Plattform, die mithilfe fortschrittlicher KI-Technologie detaillierte Personas aus Datensätzen erstellt." />
                        <meta property="og:title" content="PersonaKit – Joschka Kreusser" />
                        <meta property="og:description" content="PersonaKit ist eine SaaS-Plattform, die mithilfe fortschrittlicher KI-Technologie detaillierte Personas aus Datensätzen erstellt." />
                        <meta property="og:image" content="/personakit/personakit_cover.webp" />
                        <link rel="canonical" href="https://www.joschka-kreusser.de/personakit" />
                      </Helmet>
                      <PersonaKit />
                      <section className='w-full bg-white'>
                        <Footer />
                      </section>
                    </>
                  }
                />
                <Route
                  path="/dentaltechnik-weber"
                  element={
                    <>
                      <Helmet>
                        <title>Dentaltechnik Weber – Joschka Kreusser</title>
                        <meta name="description" content="Dentaltechnik Weber ist ein renommiertes Dentallabor, das durch hochwertige Zahntechnik und exzellenten Service überzeugt." />
                        <meta property="og:title" content="Dentaltechnik Weber – Joschka Kreusser" />
                        <meta property="og:description" content="Dentaltechnik Weber ist ein renommiertes Dentallabor, das durch hochwertige Zahntechnik und exzellenten Service überzeugt." />
                        <meta property="og:image" content="/weber/weber_cover.webp" />
                        <link rel="canonical" href="https://www.joschka-kreusser.de/dentaltechnik-weber" />
                      </Helmet>
                      <DentaltechnikWeber />
                      <section className='w-full bg-white'>
                        <Footer />
                      </section>
                    </>
                  }
                />
                <Route
                  path="/shape-up"
                  element={
                    <>
                      <Helmet>
                        <title>ShapeUp - Mein Portfolio</title>
                        <meta name="description" content="Details zu meinem Projekt ShapeUp." />
                        <meta property="og:title" content="ShapeUp - Mein Portfolio" />
                        <meta property="og:description" content="Details zu meinem Projekt ShapeUp." />
                        <meta property="og:image" content="URL-zum-Bild" />
                        <link rel="canonical" href="https://www.meinewebsite.de/shape-up" />
                      </Helmet>
                      <ShapeUp />
                      <section className='w-full bg-white'>
                        <Footer />
                      </section>
                    </>
                  }
                />
              </Routes>
              {(firstLoad || state === 'entering' || state === 'exiting') && (
                <div className="fixed inset-0 bg-black flex items-center justify-center z-50">
                  <Lottie animationData={logoAnimation} style={{ height: '200px', width: '200px' }} />
                </div>
              )}
            </div>
          )}
        </CSSTransition>
      </TransitionGroup>
    </div>
  );
}

export default function Root() {
  return (
    <HelmetProvider>
      <Router>
        <App />
      </Router>
    </HelmetProvider>
  );
}
